function Cart(){
    return(
        <div>
            <div>
            {data.map((one) => (
                <ul style={{ listStyle: "none" }}>
                  <div id="b">
                    <img
                      src={one.img}
                      style={{
                        width: "200px",
                        height: "200px",
                        marginLeft: "8px",
                      }}
                    ></img>
                    <li>
                      <span style={{ fontSize: "18px", marginLeft: "35px" }}>
                        Brand :{" "}
                      </span>
                      {one.brand}{" "}
                    </li>
                    <li style={{ marginLeft: "35px" }}>{one.collection}</li>
                    <li>
                      <span style={{ fontSize: "18px", marginLeft: "35px" }}>
                        Model :{" "}
                      </span>
                      {one.model}
                    </li>
                    <li style={{ marginLeft: "35px" }}>{one.reference}</li>
                    <li style={{ marginLeft: "35px" }}>{one.complement}</li>
                    <li>
                      <span style={{ fontSize: "18px", marginLeft: "35px" }}>
                        Year :{" "}
                      </span>
                      {one.year}
                    </li>
                    <li>
                      <span style={{ fontSize: "18px", marginLeft: "35px" }}>
                        Price :</span>{one.price}<a style={{ color: "blue", fontSize: "20px" }}>$</a></li>
                    <button id="a" className="btn btn-success">  Add Cart </button>
                  </div>
                </ul>
              ))}
            </div>
        </div>
    )
}
